import axios from "axios";
import { GET_LEADS } from "./types";

//Get Leads 

export const getLeads = () => dispatch => {
    axios
    .get('/api/post-list')
    .then(res => {
        dispatch({
            type: GET_LEADS,
            payload: res.data
        });
    }).catch(err => console.log(err));
}
